import './App.css';
import AboutMe from './components/AboutMe';

function App() {

  const [isShownAboutMe, setIsShownAboutMe] = useState(false);
  const [isShownTechnologies, setIsShownTechnologies] = useState(false);
  const [isShownExperiencies, setIsShownExperiences] = useState(false);
  const [isShownHobbies, setIsShownHobbies] = useState(false);
  const [isShownContact, setIsShownContact] = useState(false);

  const handleClick = event => {
    setIsShownYear(current => !current);
    setIsShownArtist(false);
  }

  const handleClickArtist = event => {
    setIsShownArtist(current => !current);
    setIsShownYear(false)
  }

  return (
    <div className="App">
      <h1>Alejandro Guerrero Aguilar</h1>
      <h3>Software Engineer</h3>
      <div className='options'>
        <button>About Me</button>
        <button>Technologies</button>
        <button>Experience</button>
        <button>Hobbies</button>
        <button>Contact</button>
      </div>
      <AboutMe />
    </div>
  );
}

export default App;
